        fun getRandomString(length: Int): String {
            val allowedChars = ('A'..'Z') + ('a'..'z') + ('0'..'9')
            return (1..length)
                .map { allowedChars.random() }
                .joinToString("")
        }
        fun playSoundHello(context: Context){
            val mPlayer: MediaPlayer = MediaPlayer.create(context, com.batdaulaptrinh.completlearningenglishapp.R.raw.hello__gb_1)
            mPlayer.start()
        }


